"use strict";function createInfoWindow(n){return'<div id="truckDetail">\n                <h1>'+n.name+"</h1>\n                <h3>"+n.description_short+"</h3>\n                <p>"+n.description_long+"</p>\n                "}function createMarker(n,e){return new google.maps.Marker({title:n.name,icon:"../img/truck.png",position:n.position,map:e,animation:google.maps.Animation.DROP})}function getData(n){fetch("http://localhost:1337/data.streetfoodapp.com/1.1/schedule/vancouver/").then(function(e){e.json().then(function(e){n(e)})})}function getTrucks(n){getData(function(e){for(var o=Object.keys(e.vendors),t=o.length,i=0;i<=t;i++)e.vendors[o[i]]&&"last"in e.vendors[o[i]]&&function(){var t={name:e.vendors[o[i]].name,position:{lat:e.vendors[o[i]].last.latitude,lng:e.vendors[o[i]].last.longitude},email:e.vendors[o[i]].email,rating:e.vendors[o[i]].rating,description_long:e.vendors[o[i]].description,description_short:e.vendors[o[i]].description_short},r=createInfoWindow(t);t.infowindow=new google.maps.InfoWindow({content:r}),t.marker=createMarker(t,n),t.marker.addListener("click",function(){t.infowindow.open(n,t.marker)}),trucks.push(t)}()})}function initMap(){getTrucks(new google.maps.Map(document.getElementById("map"),{zoom:13,center:{lat:49.246292,lng:-123.116226}}))}var openWindow=void 0,trucks=[];